// React
import React, { Fragment } from "react";

import { Row, Col, Card, Divider, Typography } from "antd";
import { EditTwoTone, DeleteTwoTone } from "@ant-design/icons";

const { Meta } = Card;
const { Paragraph } = Typography;
const OrderedList = ({ data }) => {
  return (
    <Fragment>
      <Row>
        {data.map(data => (
          <Col span={6} style={{ width: "400px" }}>
            <Card
              className="border border-warning rounded m-2"
              title={<p>{`Table ${data.table}`}</p>}
              cover={
                <div className="container">
                  <h1
                    className="text-center text-uppercase font-weight-light mt-4 text-secondary"
                    type="warning"
                  >
                    {data.customer}
                    <Divider className="mt-4" />
                  </h1>
                </div>
              }
              actions={[
                <EditTwoTone />,
                <DeleteTwoTone twoToneColor="#ff4500" />
              ]}
            >
              <Meta
                title={
                  <Paragraph ellipsis={{ rows: 1, expandable: true }}>
                    {data.ordered_items}
                  </Paragraph>
                }
                description={`Time: ${data.time}`}
              />
            </Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default OrderedList;
